$("#status").fadeOut(); // will first fade out the loading animation
$("#preloader").delay(350).fadeOut("slow"); // will fade out the white DIV that covers the website.

// Navigation
$(document).ready(function() {
	// Desktop DropDown Navigation
	
	
	// Prevent parent menu items with children from navigating when clicked
	$('ul.desktopMenu li:has(ul)').on('click', function(e) {
		if ($(e.target).closest('a').length && $(e.target).closest('li').has('ul').length) {
			e.preventDefault();
			// Toggle submenu on click as well
			var $submenu = $(this).children('ul');
			if ($submenu.is(':visible')) {
				$submenu.hide(100);
			} else {
				$submenu.stop(true, true).slideDown(250);
			}
		}
	});
	
	// Close dropdown menus when clicking outside
	$(document).on('click', function(e) {
		if (!$(e.target).closest('ul.desktopMenu').length) {
			$('ul.desktopMenu li ul').hide(100);
		}
	});
	// Mobile Navigation Toggle
    $('#toggle-menu').click(function(){
        if($("nav ul").is(":visible")){
            $('nav ul').slideUp(250);
        } else {
            $('nav ul').slideDown(250);
        }
    });
});

$(document).mouseup(function(e){
    if(window.matchMedia('(max-width: 1199px)').matches){
        var menu = $('nav ul');
        if (!menu.is(e.target) // The target of the click isn't the container.
        && menu.has(e.target).length === 0) // Nor a child element of the container
        {
                menu.slideUp();
        }
    }
});

$(window).resize(function() {
    if(window.matchMedia('(min-width: 1200px)').matches) {
        $('nav ul').show();
    }
    if(window.matchMedia('(min-width: 1200px)').matches) {
        $('ul.desktopMenu li ul').hide();
    }
    if(window.matchMedia('(max-width: 1199px)').matches) {
        $('nav ul').hide();
    }
});

// Clone Cloud Assessment Image
$(document).ready(function() {
    var $bgImg = $('#iac-audit .bg-image').clone();
    $('#iac-audit').append($bgImg);
});

// FAQs
$(document).ready(function() {
    var allPanels = $('#faqsBlock .faqA').hide();
    $('#faqsBlock > .faqBx:first-child .faqA').show();
    $('#faqsBlock > .faqBx:first-child .faqQ').addClass('active-faq');
    $('#faqsBlock .faqQ').click(function() {
        if ($(this).hasClass('active-faq')) {
            $(this).next().slideUp(250);
			$(this).removeClass('active-faq');
        } else {
            allPanels.slideUp();
            $('#faqsBlock .faqQ').removeClass('active-faq');
            $(this).next().slideDown(250);
            $(this).addClass('active-faq');
            return false;
        }
    });
});

